import React from "react";
import { useParams } from "react-router-dom";
import { HomeData } from "../Home";

const Page = () => {
  const { id } = useParams(); // Fixed: useParams should be called as a function
  const data = HomeData[id];

  if (!data) {
    return <h1>Data not found</h1>; // Handle invalid or missing data
  }

  return (
    <div>
      <img src={data.imgurl} alt={data.heading} />
      <h1>{data.heading}</h1>
      <p>{data.content}</p>
    </div>
  );
};

export default Page;
